import React from "react";
import bg from "./faq.png";
import "./Blog.css";

const myComponentStyle = {};
const Blogs = () => {
  return (
    <div>
      <div className="text-center">
        <p className="text-primary font-medium">Blogs</p>
        <p className="font-bold text-xl"> Get ready for healhy blogs </p>
      </div>
      <div className="flex  ">
        <div
          className="  customcss box h-80 w-64 m-8 flex    rounded  bg-primary bg-[url('https://1.bp.blogspot.com/-kK7Fxm7U9o0/YN0bSIwSLvI/AAAAAAAACFk/aF4EI7XU_ashruTzTIpifBfNzb4thUivACLcBGAsYHQ/s1280/222.jpg')] bg-cover bg-center 
         "
          style={myComponentStyle}
        >
          <img
            src="https://images.pexels.com/videos/3045163/free-video-3045163.jpg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            className="rounded self-end opacity-90 h-full"
          ></img>
        </div>
      </div>
    </div>
  );
};

export default Blogs;
